import React from "react";
import Common from "./Common";
import web from "../src/Images/business.jpg";

const Home = () => {
  return (
    <>
   <Common name='To know more about me'
     imgsrc={web}
     visit="/service"
     btnname="Get Started"
   />
    </>
  );
};
export default Home;
